import React from "react";

const Nav = () => {
  const navlinks = ["Home", "Profile", "Courses", "Result", "Accouts"];
  return (
    <div className="bg-green-200">
      <div className="flex item-center justify-between w-11/12 mx-auto py-3">
        <h1 className="text-2xl font-serif font-bold md:text-3xl text-red-600">
          Student Portal
        </h1>
        <div>
          <span>Home</span>
          <span>Profile</span>
          <span>Courses</span>
          <span>Result</span>
          <span>Accounts</span>
        </div>
      </div>
    </div>
  );
};

export default Nav;
